import RoboChart from '@postlight/react-google-sheet-to-chart';
import './App.css';

const style = { width: '1200px', margin: '0 auto' };
class App extends Component {
  render() {
    return (
        <div style={style}>
          <RoboChart
              id="1eaW565Db1ds4OhhIGdMZ0QDj2w8GYpOwrDcsVJGmQWc"
              sheet="Sheet1"
              token="AIzaSyBwS7UWKl8eel-whIjpIQ_z9uTWbHW_Pjw"
              type = "line"
              title = "Number of visitors per date"
          />
        </div>
    );
  }
}
export default App;

